import React, { Component } from 'react'
import Card from "../card/Card"
import data from './games.json'
games= data.games
export default class home extends Component {

    render() {
        return (
            <div>
                <div className="container">
        {games.map(game=>(
          <Card game= {game}/>
        ))}
      </div>
            </div>
        )
    }
}
